import { useEffect, useState } from "react";

const useFetch = (url) => {
    const [data,setData]=useState('');
    const [error, setError]=useState('');

    useEffect(()=>{
        fetch(url)
            .then(res=>{
                if(!res.ok){
                    throw Error('Can not get data')
                }
                return res.json();
            })
            .then(data=>{
                setData(data)
                setError(null);
            })
            .catch(err=>{
                setError(err.message)
            })
    },[url])

    return data;
}
 
export default useFetch;
